function Projects() {
    return (
        <div className="container my-5">
            <h2>Projects</h2>
            <div className="card mb-3">
                <div className="card-body">
                    <h5 className="card-title">Magical Robot</h5>
                    <p className="card-text">An old project of mine from highschool. Click wherever and it'll make a sound on the body part
                        of the robot you clicked like "Hand" and so on. This will be the general format of the projects once we do the back-end
                    </p>
                </div>
            </div>
        </div>
    );
}

export default Projects;
